;; gorilla-repl.fileformat = 1

;; **
;;; # Mastering masking
;;; 
;; **

;; @@
(ns tasteless-lagoon
  (:require
    [opencv4.core :refer :all]
    [opencv4.utils :as u]
[opencv4.gorilla :as g]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## read the original picture
;; **

;; @@
(def rose
  (-> "resources/matching/rose_flower.jpg"
      imread
      (u/resize-by 0.15)))
(g/>> rose)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3a5e80e5 \"BufferedImage@3a5e80e5: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## convert the color space to HSV
;; **

;; @@
(def hsv
  (-> rose clone (cvt-color! COLOR_BGR2HSV)))

(g/>> hsv)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x56f0dc3f \"BufferedImage@56f0dc3f: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## filter on red and create a mask from that filtering
;; **

;; @@
(def lower-red  (new-scalar 0 70 70))
(def upper-red (new-scalar 10 255 255))
(def mask (new-mat))
(in-range hsv lower-red upper-red mask)

(g/>> mask)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x69254962 \"BufferedImage@69254962: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@553b8b78 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; ## pick up pixels from the original pictures that are selected by the mask
;; **

;; @@
(def res (new-mat))
(bitwise-and! rose res mask)
(g/>> res)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6886ce7b \"BufferedImage@6886ce7b: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## adjust luminosity of the pixels selected by the mask
;; **

;; @@
; change the color by using convert-to and
; apply  original*alpha  + beta on each pixel
(def res2 (new-mat))
(convert-to res res2 -1 1 100)

(g/>> res2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x57e0b681 \"BufferedImage@57e0b681: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
; copy the updated picture (which is the masked portion)
; to the original (a clone of)
(def cl (clone rose))
(copy-to res2 cl mask)

(g/>> cl)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5bc9d3ff \"BufferedImage@5bc9d3ff: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## copy something completely different using the mask
;; **

;; @@
(def cl2 
  (imread "resources/inside-a-hot-air-balloon.jpg"))
(def cl3 
  (clone rose))

(resize! cl2 (new-size (cols mask) (rows mask)))
(g/>> cl2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7107d722 \"BufferedImage@7107d722: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(copy-to cl2 cl3 mask)

(g/>> cl3)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"127\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7fe6fabf \"BufferedImage@7fe6fabf: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 127 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=
